import styled from "styled-components";

const Boton = styled.button`
    background-color: #fff; /* Green */
    color: #503459;
    padding: 15px 32px;
    text-align: center;
    font-size: 16px;

    &::hover{
        background-color: #81638b; /* Green */
        color: #503459;
    }
`;

export default Boton;
